import React from 'react'
import {Navbar, Button, Form, FormControl, Nav, Card } from 'react-bootstrap'


const API_KEY = "886705b4c1182eb1c69f28eb8c520e20"

const WetherInf = async () => {
    const api_url = await fetch(`http://api.openweathermap.org/data/2.5/weather?q=London&appid=${API_KEY}&units=metric`)
    const data = await api_url.json()
    // console.log(data)
}

 function WeatherBar() {
    return (
    <Navbar bg="dark" variant="dark">
       <Navbar.Brand>Weather</Navbar.Brand>
         <Nav className="mr-auto">
           <Nav.Link href="/">Main Page</Nav.Link>
           <Nav.Link href="DetInform">Detailed Information</Nav.Link>
         </Nav>
       <Form inline>
         <FormControl type="text" placeholder="Search" className="mr-sm-2" />
         <Button variant="outline-info">Search</Button>
       </Form>
    </Navbar>
    )
}

 const CityCards = () => {

    <Card style={{width: '18prem'}}>
      <Card.Body>
        <Card.Title>City</Card.Title>
        <Card.Text>
          <input type="text" name="city" placeholder="City" />

        </Card.Text>
        <Button variant="primary">Go</Button>
      </Card.Body>
    </Card>
}

export default (WeatherBar, CityCards)
